import React, {useEffect} from 'react'

import { DropDownContainer, DropDown } from "./drop-down.styles";

const AssetDropDown =({getAssetOptions, assets, memberId }) => {

    useEffect(() => {
        // Get Data from /allunits.
        getAssetOptions(memberId)
      }, [getAssetOptions, memberId]); //
    
    return(
        <DropDownContainer autoFocus>
            <DropDown>
                <option text=' '/>
                {   
                    assets ? (
                        assets.map(asset => (
                    <option key={ asset.id }> { asset.id } </option> 
                    ))
                    ):(
                    <option></option>
                    )
                }
            </DropDown>
        </DropDownContainer>
    )
}


export default AssetDropDown;
